import React from 'react'

const ProjectsBox = () => {
    return (
        <div className="w-auto h-[90vh] bg-white rounded-2xl mx-4 my-4 drop-shadow-sm flex justify-center flex-col align items-end">
            <span className="font-sans font-bold">Nasze projekty</span>
            <div className="w-40 h-20 "></div>
        </div>
    )
}

export default ProjectsBox
